const TodosList = ({todos, setTodos}) => {
    return (
        <div>
          {todos.map((todo) => (
            <li className="list-item" key={todo.id}>
            {/* <li className="todo-list" key={todo.id}> */}
                <input 
                type= "text" 
                value={todo.tile} 
                className="list" 
                onChnage={(event)=> event.preventDefault} />
            </li>
          ))}
        </div>
    )
}
export default TodosList;
